import React from 'react';

function AboutPage() {

  const text = `栃木県在住の現在バンタンテックフォードアカデミーに在学中の22歳の男。
                中学3年から3年間アメリカに住んでいたため、英語が得意。
                高校では作新学院トップ英進部に通い、学校卒業後は色々あり進学できなかったため２年間学費をためるために飲食店で契約社員として働く。
                `

  return (
    <div className='about'>
      <div className='about-title'>
        Career
      </div>
      <div className='about-my-career'>
        {text}
      </div>
    </div>

  )
}

export default AboutPage;
